<!DOCTYPE html>
<!--
	NOTES:
	1. All tokens are represented by '$' sign in the template.
	2. You can write your code only wherever mentioned.
	3. All occurrences of existing tokens will be replaced by their appropriate values.
	4. Blank lines will be removed automatically.

<html>
<head>
<meta charset="UTF-8">
<meta name="viewport" content="width=device-width, initial-scale=1.0, maximum-scale=1.0, minimum-scale=1.0, user-scalable=no, minimal-ui">
<meta name="apple-mobile-web-app-capable" content="yes">
<meta name="apple-mobile-web-app-status-bar-style" content="black">
<meta name="HandheldFriendly" content="true">
<meta name="mobile-web-app-capable" content="yes">
<meta charset="UTF-8">
<script>
var CTA = {
    onClick: function (store) {
        if (store === undefined)
            store = navigator.userAgent.toLowerCase().indexOf("android") > -1 ? "google" : "apple";
        var urls = {
            "google": "",
            "apple": ""
        };
        var url = urls[store];
        window.console.log("CTA Clicked store: " + store + " link: " + url);
        //mraid.open(url);
    }
};
</script>
<style>
video::-webkit-media-controls {
    display:none !important;
}
video::-webkit-media-controls-timeline {
  display: none;
}

video::-webkit-media-controls-current-time-display {
  display: none;
}
video::-webkit-media-controls-start-playback-button {
    display: none !important;
    -webkit-appearance: none;
}
video::-moz-range-track{
   display: none !important;
}
.IIV::-webkit-media-controls{
    opacity: 0;
    pointer-events: none;
    width: 5px;
}

.video::-webkit-media-controls{
    opacity: 0;
    pointer-events: none;
    width: 5px;
}

video::-webkit-media-controls-timeline {
    display: none;
}

video {
        font-size: 2em;
      }

* {
        -webkit-user-select: none;
        -moz-user-select: none;
        -ms-user-select: none;
        user-select: none;
      }
      video::-webkit-media-controls {
        display: none !important;
      }
      video::--webkit-media-controls-play-button {
        display: none !important;
        -webkit-appearance: none !important;
      }
      .video {
        right: 0;
        -o-object-fit: cover;
        object-fit: cover;
      }

	html,
	body {
		touch-action: none;
		font-family: 'score';
	}
	
	body {
		overflow: hidden;
	}

	.cta {
		position: absolute;
		left: 50%;
		transform: translateX(-50%);
		bottom: 66%;
		max-width: 302px;
		width: 61%;
		opacity: 0;
		display: block;
	}

	

	#animation_container {
		position: absolute;
		margin: auto;
	}

	/*IE9*/
	*::selection {
		background-color: transparent;
	}

	*::-moz-selection {
		background-color: transparent;
	}

	* {
		-webkit-user-select: none;
		-moz-user-select: -moz-none;
		/*IE10*/
		-ms-user-select: none;
		user-select: none;
		/*You just need this if you are only concerned with android and not desktop browsers.*/
		-webkit-tap-highlight-color: rgba(0, 0, 0, 0);
	}

	input[type="text"],
	textarea,
	[contenteditable] {
		-webkit-user-select: text;
		-moz-user-select: text;
		-ms-user-select: text;
		user-select: text;
	}

	* {
		outline: none;
		-moz-user-select: none;
		-o-user-select: none;
		-ms-user-select: none;
		-webkit-user-select: none;
		user-select: none;
		touch-action: manipulation;
	}

	.counter {
		width: 50%;
		height: 10%;
		color: #eed505;
		top: 0;
		left: 50%;
		font-size: 5vh;
	}


	canvas {
		-webkit-transition-duration: .5s;
		-o-transition-duration: .5s;
		-moz-transition-duration: .5s;
		transition-duration: .5s;
	}

	canvas:focus {
		outline: none;
	}
	

		
	@media (orientation: landscape) {

		canvas {
			position: absolute;
			width: 100%;
			left: 50%;
			top:50%;
			transform: translate(-50%, -50%)
		}
		
		video {
			position: absolute;
			width: 100%;
			left: 50%;
			top:50%;
			transform: translate(-50%, -50%)
		}

}
	@media (orientation: portrait) {

		
		canvas {
			position: absolute;
			height: 100%;
			left: 50%;
			top:50%;
			transform: translate(-50%, -50%)
		}
		
		video {
			position: absolute;
			height: 100%;
			left: 50%;
			top:50%;
			transform: translate(-50%, -50%)
		}
		
		}
</style>

document.addEventListener("visibilitychange", function () {
	if (document.visibilityState === 'visible') {
		Howler.mute(false);
	} else {
		Howler.mute(true);
	}
})
var pause1 = -1
var pause2 = true
var video = document.getElementById('video');
video.muted = false;
video.volume = 0
video.addEventListener('ended', function () {
	createjs.Ticker.addEventListener("tick", stage);
})
createjs.Ticker.addEventListener("tick", function () {
	if (pause1 == -1 && video.currentTime >= 5.16) {
		video.pause()
		step0()
		pause1 = 0
	}
	if (pause1 == 1 && video.currentTime >= 7.28) {
		video.pause()
		video.currentTime = 8
		pause1 = 2
		step0()
	}
})
function pl() {
	if (pause2) {
		pause2 = false
		video.play()
	}
	if (pause1 == 0) {
		step0off()
		pause1 = 1
		video.play()
	}
	if (pause1 == 2) {
		step0()
		pause1 = 3
		CTA.onClick();
	}
}
